const t=JSON.parse('{"key":"v-cc702946","path":"/nice-article/cnblog/pingsdgzrhtxygrdjssd.html","title":"平时的工作如何体现一个人的技术深度？","lang":"zh-CN","frontmatter":{"title":"平时的工作如何体现一个人的技术深度？","shortTitle":"平时的工作如何体现一个人的技术深度？","author":"沧海月明FE","category":["博客园"],"description":"今天在公司内网看到一个讨论帖，原文如下： 平时的工作如何体现一个人的技术深度？ 平时工作中很多时候需求细而碎的，如何在工作中积累技术深度？又如何体现一个人的技术深度？ 思考：做需求与做需求的差异 再回答问题之前，我想先抛开「技术深度」这次词，讲讲做需求这件事，说说我对做需求的理解。每一个程序员都是从刚毕业做需求开始，为什么有的人逐渐成为大牛，主导大型技术项目或走向团队管理岗位，而有的人一直还在做需求。我觉得这里面的差异在于，每一个对做需求这件事的理解有所不同。","head":[["meta",{"property":"og:url","content":"https://javabetter.cn/nice-article/cnblog/pingsdgzrhtxygrdjssd.html"}],["meta",{"property":"og:site_name","content":"二哥的Java进阶之路"}],["meta",{"property":"og:title","content":"平时的工作如何体现一个人的技术深度？"}],["meta",{"property":"og:description","content":"今天在公司内网看到一个讨论帖，原文如下： 平时的工作如何体现一个人的技术深度？ 平时工作中很多时候需求细而碎的，如何在工作中积累技术深度？又如何体现一个人的技术深度？ 思考：做需求与做需求的差异 再回答问题之前，我想先抛开「技术深度」这次词，讲讲做需求这件事，说说我对做需求的理解。每一个程序员都是从刚毕业做需求开始，为什么有的人逐渐成为大牛，主导大型技术项目或走向团队管理岗位，而有的人一直还在做需求。我觉得这里面的差异在于，每一个对做需求这件事的理解有所不同。"}],["meta",{"property":"og:type","content":"article"}],["meta",{"property":"og:locale","content":"zh-CN"}],["meta",{"property":"og:updated_time","content":"2022-08-16T08:29:38.000Z"}],["meta",{"property":"article:author","content":"沧海月明FE"}],["meta",{"property":"article:modified_time","content":"2022-08-16T08:29:38.000Z"}],["script",{"type":"application/ld+json"},"{\\"@context\\":\\"https://schema.org\\",\\"@type\\":\\"Article\\",\\"headline\\":\\"平时的工作如何体现一个人的技术深度？\\",\\"image\\":[\\"\\"],\\"dateModified\\":\\"2022-08-16T08:29:38.000Z\\",\\"author\\":[{\\"@type\\":\\"Person\\",\\"name\\":\\"沧海月明FE\\"}]}"]]},"headers":[],"git":{"createdTime":1660638578000,"updatedTime":1660638578000,"contributors":[{"name":"沉默王二","email":"www.qing_gee@163.com","commits":1}]},"readingTime":{"minutes":7.83,"words":2350},"filePathRelative":"nice-article/cnblog/pingsdgzrhtxygrdjssd.md","localizedDate":"2022年8月16日","excerpt":"<p>今天在公司内网看到一个讨论帖，原文如下：</p>\\n<blockquote>\\n<p><strong>平时的工作如何体现一个人的技术深度？</strong></p>\\n<p>平时工作中很多时候需求细而碎的，如何在工作中积累技术深度？又如何体现一个人的技术深度？</p>\\n</blockquote>\\n<h1> 思考：做需求与做需求的差异</h1>\\n<p>再回答问题之前，我想先抛开「技术深度」这次词，讲讲做需求这件事，说说我对做需求的理解。每一个程序员都是从刚毕业做需求开始，为什么有的人逐渐成为大牛，主导大型技术项目或走向团队管理岗位，而有的人一直还在做需求。我觉得这里面的差异在于，每一个对做需求这件事的理解有所不同。</p>","autoDesc":true}');export{t as data};
